import React, { useState, useEffect } from 'react';
import ProjectGrid from './components/ProjectGrid';
import './App.css';

const App = () => {
  const [theme, setTheme] = useState('light');

  // Cargar el tema desde localStorage al iniciar
  useEffect(() => {
    const savedTheme = localStorage.getItem('theme') || 'light';
    setTheme(savedTheme);
    document.documentElement.setAttribute('data-theme', savedTheme);
  }, []);

  // Cambiar el tema cuando el toggle se activa
  const toggleTheme = () => {
    const newTheme = theme === 'light' ? 'dark' : 'light';
    setTheme(newTheme);
    document.documentElement.setAttribute('data-theme', newTheme);
    localStorage.setItem('theme', newTheme);
  };

  return (
    <div id="app">
      <header>
        <div className="header-title">
          <h1>Bone health biomarkers at a glance</h1>
        </div>
        <div className="theme-toggle">
          <label className="switch">
            <input
              className="switch__input"
              type="checkbox"
              role="switch"
              name="dark"
              checked={theme === 'dark'}
              onChange={toggleTheme}
            />
            <span className="switch__inner"></span>
            <span className="switch__inner-icons">
              <svg className="switch__icon" width="24px" height="24px" aria-hidden="true">
                <use href="#light" />
              </svg>
              <svg className="switch__icon" width="24px" height="24px" aria-hidden="true">
                <use href="#dark" />
              </svg>
            </span>
            <span className="switch__sr">Dark Mode</span>
          </label>
        </div>
      </header>
      <ProjectGrid />
      <svg display="none">
        <symbol id="light" viewBox="0 0 24 24">
          <g stroke="currentColor" strokeWidth="2" strokeLinecap="round">
            <line x1="12" y1="17" x2="12" y2="20" transform="rotate(0,12,12)" />
            <line x1="12" y1="17" x2="12" y2="20" transform="rotate(45,12,12)" />
            <line x1="12" y1="17" x2="12" y2="20" transform="rotate(90,12,12)" />
            <line x1="12" y1="17" x2="12" y2="20" transform="rotate(135,12,12)" />
            <line x1="12" y1="17" x2="12" y2="20" transform="rotate(180,12,12)" />
            <line x1="12" y1="17" x2="12" y2="20" transform="rotate(225,12,12)" />
            <line x1="12" y1="17" x2="12" y2="20" transform="rotate(270,12,12)" />
            <line x1="12" y1="17" x2="12" y2="20" transform="rotate(315,12,12)" />
          </g>
          <circle fill="currentColor" cx="12" cy="12" r="5" />
        </symbol>
        <symbol id="dark" viewBox="0 0 24 24">
          <path
            fill="currentColor"
            d="M15.1,14.9c-3-0.5-5.5-3-6-6C8.8,7.1,9.1,5.4,9.9,4c0.4-0.8-0.4-1.7-1.2-1.4C4.6,4,1.8,7.9,2,12.5c0.2,5.1,4.4,9.3,9.5,9.5
            c4.5,0.2,8.5-2.6,9.9-6.6c0.3-0.8-0.6-1.7-1.4-1.2C18.6,14.9,16.9,15.2,15.1,14.9z"
          />
        </symbol>
      </svg>
    </div>
  );
};

export default App;
